import React from 'react';

const Projects = () => {
  return (
    <section id="projects">
      <h2>Projects</h2>
      <ul>
        <li>Reddit API Design</li>
        <li>GANs for Music Generation</li>
        <li>Receipt Classification using ML</li>
      </ul>
    </section>
  );
};

export default Projects;
